import React, { useState } from "react";
import LatitudeComponent from './latitude';
import LongitudeComponent from './longitude';

const App = () => {
    const [longitude, setLongitude] = useState('');
    const [latitude, setLatitude] = useState('');
    const [danger, setDanger] = useState(null);

    const handlePredict = async () => {
        try {
            const response = await fetch('http://localhost:5000/predict', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    longitude: parseFloat(longitude),
                    latitude: parseFloat(latitude)
                })
            });
            const data = await response.json();
            setDanger(data.result);
        } catch (error) {
            console.error('Error predicting danger:', error);
        }
    };

    return (
        <div className="App">
            <h1>Predict Danger</h1>
            <div>
                <button onClick={handlePredict}>Predict Danger</button>
            </div>
            {danger !== null && <div>Predicted Danger: {danger}</div>}
        </div>
    );
};

export default App;
